import "./App.css";
import MenuMakanan from "./components/MenuMakanan/MenuMakanan";
import MenuMinuman from "./components/MenuMinuman/MenuMinuman";

function App() {
  return (
    <div className="App">
      <h1>Cafe and Resto Landensaki</h1>
      <h2>Menu Makanan</h2>
      <MenuMakanan namaMenu={"Ayam Bakar"} hargaMenu={25000} />
      <MenuMakanan namaMenu={"Ayam Goreng"} hargaMenu={20000} />
      <h2>Menu Minuman</h2>
      <MenuMinuman namaMenu={"Ayam Bakar"} hargaMenu={25000} />
    </div>
  );
}

export default App;
